INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 1, 10001, 1.47, 2, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", "クローチェ", -470.0, 0.0, 1, 126401, 2002, 1, "2023/06/30 12:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 2, 10002, 2.15, 1, "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", "クローチェ", -470.0, 0.0, 1, 126401, 2002, 2, "2023/06/30 12:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 2, 10003, 0.0, 2, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", "ライラエル", -470.0, 0.0, 1, 126501, 2002, 1, "2023/06/30 12:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/09/22 14:59:59", 1, 10004, 0.0, 1, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", "ライラエル", -470.0, 0.0, 1, 126501, 2002, 2, "2023/06/30 12:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 2, 10005, 0.0, 2, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", "リンド", -470.0, 0.0, 2, 127702, 2002, 1, "2023/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 2, 10006, 0.0, 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", "リンド", -470.0, 0.0, 2, 127702, 2002, 2, "2023/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 1, 10007, 0.0, 1, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", "ヴルム", -470.0, 0.0, 2, 127802, 2002, 1, "2023/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2023/12/22 14:59:59", 2, 10008, 6.5, 1, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", "ヴルム", -470.0, 0.0, 2, 127802, 2002, 2, "2023/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 2, 10009, 0.0, 1, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", "アネモネ", -470.0, 0.0, 3, 129602, 2002, 1, "2023/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 2, 10010, 0.0, 1, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", "アネモネ", -470.0, 0.0, 3, 129602, 2002, 2, "2023/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 1, 10011, 0.0, 1, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", "ネフィ=ネラ", -470.0, 0.0, 3, 129701, 2002, 1, "2023/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/03/22 14:59:59", 2, 10012, 6.2, 1, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", "ネフィ=ネラ", -470.0, 0.0, 3, 129701, 2002, 2, "2023/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 3, 10013, 3.1, 5, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "カノン", -470.0, 0.0, 4, 130301, 2002, 1, "2024/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 3, 10014, 6.15, 2, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", "カノン", -470.0, 0.0, 4, 130301, 2002, 2, "2024/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 2, 10015, 0.0, 2, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", "ナーナ", -470.0, 0.0, 4, 130401, 2002, 1, "2024/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/06/22 14:59:59", 2, 10016, 3.35, 1, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", "ナーナ", -470.0, 0.0, 4, 130401, 2002, 2, "2024/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 1, 10017, 0.0, 1, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", "ホウオウ", -470.0, 0.0, 5, 130502, 2002, 1, "2024/06/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 2, 10018, 3.18, 1, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", "ホウオウ", -470.0, 0.0, 5, 130502, 2002, 2, "2024/06/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 4, 10019, 0.0, 4, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", "ホウオウ", -470.0, 0.0, 5, 130503, 2002, 3, "2024/06/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 1, 10020, 4.9, 2, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", "ネア", -470.0, 0.0, 5, 123301, 2002, 1, "2024/06/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/09/22 14:59:59", 1, 10021, 4.8, 2, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", "ネア", -470.0, 0.0, 5, 123301, 2002, 2, "2024/06/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 3, 10022, 4.922, 1, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", "カリザ", -470.0, 0.0, 6, 133301, 2002, 1, "2024/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 3, 10023, 9.638, 5, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", "カリザ", -470.0, 0.0, 6, 133301, 2002, 2, "2024/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 1, 10024, 2.88, 2, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", "ミーア", -470.0, 0.0, 6, 133401, 2002, 1, "2024/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2024/12/22 14:59:59", 5, 10025, 4.818, 1, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", "ミーア", -470.0, 0.0, 6, 133401, 2002, 2, "2024/09/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 2, 10026, 1.78, 1, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", "グレイス", -470.0, 0.0, 7, 133002, 2002, 1, "2024/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 1, 10027, 6.15, 7, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", "グレイス", -470.0, 0.0, 7, 133002, 2002, 2, "2024/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 6, 10028, 4.28, 2, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", "ヴァイオレット", -470.0, 0.0, 7, 133102, 2002, 1, "2024/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/03/22 14:59:59", 1, 10029, 0.0, 1, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", "ヴァイオレット", -470.0, 0.0, 7, 133102, 2002, 2, "2024/12/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 2, 10030, 5.53, 1, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", "ルルィ", -470.0, 0.0, 8, 136902, 2002, 1, "2025/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 9, 10031, 6.05, 7, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", "ルルィ", -470.0, 0.0, 8, 136902, 2002, 2, "2025/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 2, 10032, 0.0, 1, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", "デュラン", -470.0, 0.0, 8, 137001, 2002, 1, "2025/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/06/23 14:59:59", 2, 10033, 0.0, 1, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", "デュラン", -470.0, 0.0, 8, 137001, 2002, 2, "2025/03/15 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 2, 10034, 0.0, 2, "おう\n好きなもん持ってきな", "サツキ", -470.0, 0.0, 9, 135902, 2002, 1, "2025/06/16 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 1, 10035, 4.935, 6, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", "サツキ", -470.0, 0.0, 9, 135902, 2002, 2, "2025/06/16 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 2, 10036, 7.441, 5, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", "ユキノ", -470.0, 0.0, 9, 135802, 2002, 1, "2025/06/16 15:00:00");
INSERT INTO `v1_d7efa07750f2610e6a08e20422e0eb5a0076a936e8f1d791d9f900ac158ca7a8` VALUES ("2025/09/22 14:59:59", 7, 10037, 0.0, 7, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", "ユキノ", -470.0, 0.0, 9, 135802, 2002, 2, "2025/06/16 15:00:00");
